var count = 0;

var strUser = "__App__ Audio Count";

//MARGIN, WIDTH AND HEIGHT
var margin = {top: 20, right: 50, bottom: 30, left: 50},
width = 960 - margin.left - margin.right,
height = Math.round(960*0.6) - margin.top - margin.bottom;

var formatDate = d3.time.format("%Y-%m-%d %H:%M:%S");

var x = d3.time.scale()
.range([0, width]);

var y = d3.scale.linear()
.range([height, 0]);

var xAxis = d3.svg.axis()
.scale(x)
.orient("bottom");

var yAxis = d3.svg.axis()
.scale(y)
.orient("left");

var line = d3.svg.line()
.x(function(d) { return x(d.date); })
.y(function(d) { return y(d.value); });

var graph = d3.select("#graph")
.attr("width", width + margin.left)
.attr("height", height + margin.top + margin.bottom)
.append("g")
.attr("transform", "translate(" + margin.left + "," + margin.top + ")");

var labelNum = rawdata.length;

// Add drop down list text
  var select = document.getElementById("label");
  for (var i = 0; i < labelNum; i ++)
  {
      var option = document.createElement("option");
      option.appendChild(document.createTextNode(rawdata[i].label));
      option.value = rawdata[i].label;
      select.add(option); 
  }
  select.selectedIndex = labelNum - 1;
// Change labels
function changeLabel()
{
   d3.select("#graph").remove();
   d3.select("body").append("svg").attr("id","graph");
   var e = document.getElementById("label");
   var selectedLabel = e.options[e.selectedIndex].text;
   // Update strUser
   strUser = "" + selectedLabel;
   // Display updated strUser
   console.log(strUser);
   // After that, call function chart
   rawdata.forEach(chart);
   resize();
}

function chart(rawdata, index, thearray){
// Display strUser, but nothing changes??
console.log(strUser);


data = rawdata["data"].map(type)

if(rawdata["label"] == strUser) //Display only one chart, selected by label
{
   x = d3.time.scale()
   .range([0, width]);

   y = d3.scale.linear()
   .range([height, 0]);

   xAxis = d3.svg.axis()
   .scale(x)
   .orient("bottom");

   yAxis = d3.svg.axis()
   .scale(y)
   .orient("left");

   line = d3.svg.line()
   .x(function(d) { return x(d.date); })
   .y(function(d) { return y(d.value); });

   graph = d3.select("#graph")
   .attr("width", width + margin.left)
   .attr("height", height + margin.top + margin.bottom)
   .append("g")
   .attr("transform", "translate(" + margin.left + "," + margin.top + ")");
   
   //modify scale of the charts
   x.domain(d3.extent(data, function(d) { return d.date; }));
   // Get the maximun value 
   var min = d3.min(data, function(d) { return d.value; })
   var max = d3.max(data, function(d) { return d.value; })
   var diff = max - min
   y.domain([0,max+0.1*diff]);

   graph.append("g")
   .attr("class", "x axis")
   .attr("transform", "translate(0," + height + ")")
   .call(xAxis);

   graph.append("g")
   .attr("class", "y axis")
   .call(yAxis)
   .append("text")
   .attr("transform", "rotate(-90)")
   .attr("y", 0-margin.left)
   .attr("dy", ".71em")
   .style("text-anchor", "end")
   .text(rawdata["label"]);

   graph.append("path")
   .datum(data)
   .attr("class", "line")
   .attr("d", line);
count++;
}}


function type(d) {
   if (count == 0)
      d.date = formatDate.parse(d.date);
d.value = +d.value;
return d;
}

changeLabel();
//RESIZE CHART
resize();

function resize() {
    //Find new width and height
	var width = parseInt(d3.select("#graph").style("width")) - margin.left - margin.right,
	    height = Math.round(parseInt(d3.select("#graph").style("height"))*0.6) - margin.top - margin.bottom;;
    
	//Update range with new w + h
	x.range([0, width]);
    y.range([height, 0]);
	
	//Modify tick labels
    xAxis.ticks(Math.max(width/70));
    yAxis.ticks(Math.max(height/50));
	
	// Update the axis with the new scale
    graph.select('.x.axis')
	  .attr("transform", "translate(0," + height + ")")
      .call(xAxis);
	
	graph.select('.y.axis')
	   .call(yAxis);
 
	graph.selectAll('.line')
        .attr("d", line);	
}

//Window resize event
d3.select(window).on('resize', resize);
